import headerImg from "../";

const Header = () => {
  return (
    <section className="header" style={{backgroundImage:`url(${headerImg})`, backgroundSize:"cover",backgroundPosition:"fixed"}}>
        <h1>Lorem ipsum dolor sit amet.</h1>
        <p>Lorem ipsum dolor sit amet consecters, adipisicing elit. Tempora,veritaties?</p>
    </section>
  )
}

export default Header
